;el de las actrices argentinas el colectivo de actrices argentinas se viene organizando desde que la lucha por el se hizo un lugar en la agenda del congreso de la nación . hoy reconocidas aistas realizarán una conferencia de prensa las 19hs en el multiteatro para acompañar las denuncias de compañeras del movimiento que fueron víctimas de abusos en el ámbito laboral . la exposición contará con : adriana salonia , anabel cherubito , andrea pietra , belen chavane , dolores fonzi , griselda siciliani , jazmín stua , julieta cardinali , julieta díaz , julieta oega , julieta zylberberg , lali esposito , laura azcurra , cy duplaa , noemi frenkel , thelma fardin , violeta uizberea , alejandra flechner , bárbara lombardo , cecilia dopazo , cecilia roth , cristina banegas , mia busnelli , muriel santa ana , verónica pelaccini , silvina acosta , entre otras . las actrices están revoluciodo el medio en el que trabajan con el fin de tender redes poder desempeñar su labor de forma segura . el feminismo las juntó ellas se apropiaron de la lucha para modificar las costumbres machistas desde la raíz . hoy van por una batalla más . ctrices.argentinas ctricesargentinas ;[('el', 'NN'), ('de', 'IN'), ('las', 'FW'), ('actrices', 'NNS'), ('argentinas', 'VBP'), ('el', 'JJ'), ('colectivo', 'NN'), ('de', 'IN'), ('actrices', 'NNS'), ('argentinas', 'VBP'), ('se', 'JJ'), ('viene', 'NN'), ('organizando', 'NN'), ('desde', 'NN'), ('que', 'NN'), ('la', 'NN'), ('lucha', 'FW'), ('por', 'NN'), ('el', 'FW'), ('se', 'FW'), ('hizo', 'NN'), ('un', 'JJ'), ('lugar', 'NN'), ('en', 'IN'), ('la', 'FW'), ('agenda', 'FW'), ('del', 'FW'), ('congreso', 'FW'), ('de', 'FW'), ('la', 'FW'), ('nación', 'FW'), ('.', '.'), ('hoy', 'NN'), ('reconocidas', 'NN'), ('aistas', 'NNS'), ('realizarán', 'VBP'), ('una', 'JJ'), ('conferencia', 'NN'), ('de', 'IN'), ('prensa', 'FW'), ('las', '$'), ('19hs', 'CD'), ('en', 'JJ'), ('el', 'FW'), ('multiteatro', 'FW'), ('para', 'NN'), ('acompañar', 'NN'), ('las', 'JJ'), ('denuncias', 'NN'),